import React from "react";
import Styles from "./UI/styles.module.css";

export function LoadingPage(){
	return (
		<div className={Styles.preloader}>
			<svg className={Styles.svg}>
				<defs>
					<linearGradient id="greyGradient" x1="0%" y1="0%" x2="100%" y2="0%">
						<stop offset="0%"   stop-color="#aaa" />
						<stop offset="100%" stop-color="#eeeeee" />
					</linearGradient>
				</defs>
				<circle className={Styles.animatedCircle} cx="50%" cy="50%" r="10vw" stroke-width="1vw" stroke="url(#greyGradient)" fill="transparent" stroke-dasharray="251.2" stroke-dashoffset="0"/>
			</svg>
		</div>
	);
}
